pragma solidity ^0.4.24;
import "../../node_modules/openzeppelin-solidity/contracts/math/SafeMath.sol";

import "../SharedContracts/VuupleAdmins.sol";
import "../SharedContracts/VuupleToken.sol";
import "../SharedContracts/DateTimeParser.sol";
import "./LenderEscrow.sol";

contract LenderRegistration  is DateTimeParser{
    using SafeMath for uint256;

    address public contractOwner;
    VuupleAdmins private vuupleAdmin;
    VuupleToken private vuupleToken;
    LenderEscrow public escrow;

    uint256 private balance ;
    uint256 public renewalDate; // this date stores the renewal date and exlenderReputationPointspire after 30 days
    uint256 public registerDate;
    uint256 public constant PASSING_PERCENTAGE  = 60;  // 60%  we may change it to so that reputation could be calculated based on number of factors
    uint256 public constant TARGET_POINTS = 210;  // ( 7 time  each 30 day) we may change it to so that reputation could be calculated based on number of factors
    uint256 public lenderReputationPoints; // we may change it to so that reputation could be calculated based on number of factors
    uint256 public rentedStorage;    // storage he offer to rent   in Giga         
    bool public active =true;
    bool public approved =false;
    bool public banned =false;

    modifier isOwner {
        require(contractOwner == msg.sender);
        _;
    }    
    modifier onlyVuupleAdmin() {
        require(vuupleAdmin.isVuupleAdmin(msg.sender));
        _;
    }
    modifier hasGoodReputation() {
        require((lenderReputationPoints.div(TARGET_POINTS)).mul(100)>=PASSING_PERCENTAGE);
        _;
    }

    modifier subscriptionEnded() {
        require( now >= renewalDate);
        _;
    }
    modifier unbanned() {
        require( !banned);
        _;
    }
    modifier isApproved() {
        require( !approved);
        _;
    }

    constructor ( VuupleAdmins _adminAddress , uint256 _rentedStorage , VuupleToken _vuupleToken, address _sender) public {            

        contractOwner = _sender;
        vuupleAdmin = _adminAddress;
        registerDate = now;
        rentedStorage = _rentedStorage;
        vuupleToken = _vuupleToken;
                // 2 vuuple per 1 giga



    }



    // check that the last subscription is ended
    function renewSubscription (uint256 oferedSpace ) public isOwner  subscriptionEnded  unbanned returns(bool){     // enter amount in GB

        if(!active){
            active=true;

        }
        rentedStorage = oferedSpace;
        renewalDate  =now + 2592000;// _getRenewalDate();
        escrow = new LenderEscrow(vuupleToken,renewalDate,rentedStorage*2,contractOwner);
        require(_mintToken(rentedStorage*2,escrow));
        return true;

    }
    function setActiveStatus(bool status) public isOwner  returns(bool) {

        active = status;
        if(escrow.isActive()){
            require(escrow.closeEscrow());

        }
        return true;

    }

    function addReputationalPoint() public onlyVuupleAdmin  returns(bool) {

        lenderReputationPoints += 1;
        return true;

    }

    function approve() public onlyVuupleAdmin isApproved  returns(bool){

        renewalDate  = now + 2592000;//_getRenewalDate();
        approved =true;
        escrow = new LenderEscrow(vuupleToken,renewalDate,rentedStorage*2,contractOwner);
       require(_mintToken(rentedStorage*2,escrow));
        return true;
    }

    function setBanStatus(bool status) public onlyVuupleAdmin returns(bool) {

        banned = status;
        active = !status;
        if(escrow.isActive()){
            require(escrow.closeEscrow());

        }

        return true;
    }
// // this function still need more work to integrate well with swarm
//     function decreaseStorage (uint256 _amount) public isOwner returns(bool) {
//                         rentedStorage -= _amount;
//                        return true;

//     }
  // function increaseStorgae (uint256 _amount) public isOwner {     // enter amount in GB
    //     rentedStorage += _amount;

    // }

    function withdraw( ) public isOwner /*hasGoodReputation  subscriptionEnded*/ returns (bool){
        require(escrow.withdraw());
        return true;
    }
    // function getBalance() public view isOwner returns (uint) {
    //     return vuupleToken.balanceOf(escrow) ;
    // }
    function _mintToken(uint256 value, address to) internal returns (bool) {
        require(vuupleToken.mint(to, value));
        return true;
    }
}
